    "body": "Bumps [handlebars](https://github.com/wycats/handlebars.js) from 4.3.0 to 4.5.3.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/handlebars-lang/handlebars.js/blob/master/release-notes.md\">handlebars's changelog</a>.</em></p>\n<blockquote>\n<h2>v4.5.3 - November 18th, 2019</h2>\n<p>Bugfixes:</p>\n<ul>\n<li>fix: add &quot;no-prototype-builtins&quot; eslint-rule and fix all occurences - f7f05d7</li>\n<li>fix: add more properties required to be enumerable - 1988878</li>\n</ul>\n<p>Chores / Build:</p>\n<ul>\n<li>fix: use !== 0 instead of != 0 - c02b05f</li>\n<li>add chai and dirty-chai and sinon, for cleaner test-assertions and spies,\ndeprecate old assertion-methods - 93e284e, 886ba86, 0817dad, 93516a0</li>\n</ul>\n<p>Security:</p>\n<ul>\n<li>The properties <code>__proto__</code>, <code>__defineGetter__</code>, <code>__defineSetter__</code> and <code>__lookupGetter__</code>\nhave been added to the list of &quot;properties that must be enumerable&quot;.\nIf a property by that name is found and not enumerable on its parent,\nit will silently evaluate to <code>undefined</code>. This is done in both the compiled template and the &quot;lookup&quot;-helper.\nThis will prevent new Remote-Code-Execution exploits that have been\npublished recently.</li>\n</ul>\n<p>Compatibility notes:</p>\n<ul>\n<li>Due to the security-fixes. The semantics of the templates using\n<code>__proto__</code>, <code>__defineGetter__</code>, <code>__defineSetter__</code> and <code>__lookupGetter__</code> in the respect that those expression now return\n<code>undefined</code> rather than their actual value from the proto.</li>\n<li>The semantics have not changed in cases where the properties are enumerable, as in:</li>\n</ul>\n<pre lang=\"js\"><code>{\n  __proto__: 'some string';\n}\n</code></pre>\n<ul>\n<li>The change may be breaking in that respect, but we still only\nincrease the patch-version, because the incompatible use-cases\nare not intended, undocumented and far less important than fixing\nRemote-Code-Execution exploits on existing systems.</li>\n</ul>\n<p><a href=\"https://github.com/wycats/handlebars.js/compare/v4.5.2...v4.5.3\">Commits</a></p>\n<h2>v4.5.2 - November 13th, 2019</h2>\n<h1>Bugfixes</h1>\n<ul>\n<li>fix: use String(field) in lookup when checking for &quot;constructor&quot; - d541378</li>\n<li>test: add fluent API for testing Handlebars - c2ac79c</li>\n</ul>\n<p>Compatibility notes:</p>\n<!-- raw HTML omitted -->\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/c819c8b533934d2ac18001d7eb27a3205b00c2f3\"><code>c819c8b</code></a> v4.5.3</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/827c9d0747bef7d7f89829779523b6b2dcf3051d\"><code>827c9d0</code></a> Update release notes</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/f7f05d7558e674856686b62a00cde5758f3b7a08\"><code>f7f05d7</code></a> fix: add &quot;no-prototype-builtins&quot; eslint-rule and fix all occurences</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/198887808780bbef9dba67a8af68ece091d5baa7\"><code>1988878</code></a> fix: add more properties required to be enumerable</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/886ba86c2f9cc71b7d99b9018fbe2d72a57085cc\"><code>886ba86</code></a> test/chore: add chai/expect and sinon to &quot;runtime&quot;-environment</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/0817dad7e72c51d07f7700547d0c69aa79a4976b\"><code>0817dad</code></a> test: add sinon as global variable to eslint in the specs</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/93516a0b07026ebd23c84fddf270a0c8b570bc59\"><code>93516a0</code></a> test: add sinon.js for spies, deprecate current assertions</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/93e284ed9be1e38c5e6945f15af1ccd689f2ada6\"><code>93e284e</code></a> chore: add chai and dirty-chai for better test assertions</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/c02b05fa819f46bb66c878bebc6e8006408ebd5c\"><code>c02b05f</code></a> fix: use !== 0 instead of != 0</li>\n<li><a href=\"https://github.com/handlebars-lang/handlebars.js/commit/8de121d21c88a6ab877e3a0eec9daaac483f3bf0\"><code>8de121d</code></a> v4.5.2</li>\n<li>Additional commits viewable in <a href=\"https://github.com/wycats/handlebars.js/compare/v4.3.0...v4.5.3\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=handlebars&package-manager=npm_and_yarn&previous-version=4.3.0&new-version=4.5.3)](https://docs.github.com/en/github/managing-security-vulnerabilities/configuring-github-dependabot-security-updates)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n\nYou can disable automated security fix PRs for this repo from the [Security Alerts page](https://github.com/glimmerjs/glimmer-playground/network/alerts).\n\n</details>",
