    "body": "Bumps [markdown-to-jsx](https://github.com/probablyup/markdown-to-jsx) from 6.11.1 to 6.11.4.\n<details>\n<summary>Release notes</summary>\n<p><em>Sourced from <a href=\"https://github.com/probablyup/markdown-to-jsx/releases\">markdown-to-jsx's releases</a>.</em></p>\n<blockquote>\n<p>6.11.4: Mitigates security vulnerability where maliciously crafted markdown links could use <code>data:</code> or <code>vbscript:</code> urls to trigger an xss injection ( <a href=\"https://github-redirect.dependabot.com/probablyup/markdown-to-jsx/issues/306\">#306</a> / <a href=\"https://www.npmjs.com/advisories/1219\">https://www.npmjs.com/advisories/1219</a> ), even when using <code>options.disableParsingRawHTML</code></p>\n<p>Note that currently, the default <code>options.disableParsingRawHTML = false</code> should still only be used for trusted input, as arbitrary html, including script tags.</p>\n<p>6.11.3 has no changes (I held the publish script upside down; the only change from 6.11.2 is the version number 😅)</p>\n<h2>6.11.2</h2>\n<p>[FIX] - Footnote references (<a href=\"https://github-redirect.dependabot.com/probablyup/markdown-to-jsx/issues/304\">#304</a>) thanks <a href=\"https://github.com/csantos1113\">@csantos1113</a></p>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/probablyup/markdown-to-jsx/commit/0d2ddc04d2ba9bf4215cc76d6f6e2717db6ddc8e\"><code>0d2ddc0</code></a> v6.11.4</li>\n<li><a href=\"https://github.com/probablyup/markdown-to-jsx/commit/105d6a6998f9fb23795843355da4a7ed1e106a29\"><code>105d6a6</code></a> XSS: Fix sanitizeUrl vbscript/data xss</li>\n<li><a href=\"https://github.com/probablyup/markdown-to-jsx/commit/8dfbc86326e7de0557b7c0af32b9483ab21afba4\"><code>8dfbc86</code></a> Create CONTRIBUTING.md</li>\n<li><a href=\"https://github.com/probablyup/markdown-to-jsx/commit/47f0bb1aa8606e00fc1222eb5450a7b81960358d\"><code>47f0bb1</code></a> v6.11.2</li>\n<li><a href=\"https://github.com/probablyup/markdown-to-jsx/commit/66e256765c1290002cb43976b50ed93f80dbb429\"><code>66e2567</code></a> [FIX] - Footnote references (<a href=\"https://github-redirect.dependabot.com/probablyup/markdown-to-jsx/issues/304\">#304</a>)</li>\n<li>See full diff in <a href=\"https://github.com/probablyup/markdown-to-jsx/compare/6.11.1...6.11.4\">compare view</a></li>\n</ul>\n</details>\n<details>\n<summary>Maintainer changes</summary>\n<p>This version was pushed to npm by <a href=\"https://www.npmjs.com/~ariabuckles\">ariabuckles</a>, a new releaser for markdown-to-jsx since your current version.</p>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://dependabot-badges.githubapp.com/badges/compatibility_score?dependency-name=markdown-to-jsx&package-manager=npm_and_yarn&previous-version=6.11.1&new-version=6.11.4)](https://docs.github.com/en/github/managing-security-vulnerabilities/configuring-github-dependabot-security-updates)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n\nYou can disable automated security fix PRs for this repo from the [Security Alerts page](https://github.com/glimmerjs/glimmer-experimental/network/alerts).\n\n</details>",
